import React, { useEffect, useState } from "react";
import { NavLink } from "react-router-dom";

const Sidebar = () => {
  const role = localStorage.getItem("role") || "Student"; 
  return (
    <div className="sidebar">
      <h2 className="logo">üéì IT Academy</h2>
      {role === "Student" && (
        <>
          <h3 className="section-title">Student Portal</h3>
          <ul className="nav-links">
            <li><NavLink to="/student/profile">üë§ Profile</NavLink></li>
            <li><NavLink to="/student/application">üìù Apply</NavLink></li>
            <li><NavLink to="/student/payments">üí≥ Payments</NavLink></li>
          </ul>
        </>
      )}
    </div>
  );
};

const StuProfile = () => {
  const [student, setStudent] = useState(null);

  useEffect(() => {
    // Normally, you'd get logged-in student ID from token/localStorage
    const studentId = localStorage.getItem("studentId") || "PUT_MONGO_ID_HERE";

  fetch(`http://localhost:5000/api/students/${studentId}`)
  .then(res => {
    console.log("üì° Response status:", res.status);
    return res.json();
  })
  .then(data => {
    console.log("üì° Response data:", data);
    setStudent(data);
  })
  .catch(err => console.error("‚ùå Error fetching student:", err));

  }, []);

  if (!student) {
    return <div className="page">‚è≥ Loading profile...</div>;
  }

  return (
    <div className="layout">
      <Sidebar />

      <div className="page">
        <h1 className="page-title">üë§ Student Profile</h1>

        {/* Profile Header */}
        <div className="profile-header">
          <img
            src="https://i.pravatar.cc/120?img=12"
            alt="Student Avatar"
            className="avatar"
          />
          <div>
            <h2>{student.fullName}</h2>
            <p className="student-email">üìß {student.email}</p>
            <p className="student-phone">üìû {student.phone}</p>
          </div>
        </div>

        {/* Personal Info */}
        <div className="card">
          <h3>Personal Information</h3>
          <p><strong>Course Interested:</strong> {student.course}</p>
          <p><strong>Joining Date:</strong> {student.joiningDate}</p>
        </div>

        {/* Uploaded Docs */}
        <div className="card">
          <h3>Uploaded Documents</h3>
          <ul>
            <li>ID Proof: {student.documents?.idProof ? "‚úÖ Uploaded" : "‚ùå Not Uploaded"}</li>
            <li>Marksheet: {student.documents?.marksheet ? "‚úÖ Uploaded" : "‚ùå Not Uploaded"}</li>
            <li>Photo: {student.documents?.photo ? "‚úÖ Uploaded" : "‚ùå Not Uploaded"}</li>
          </ul>
        </div>

        {/* Applications */}
        <div className="card">
          <h3>Applications</h3> 
          <table className="table">
            <thead>
              <tr><th>Course</th><th>Status</th><th>Date Applied</th></tr>
            </thead>
            <tbody>
              {student.applications?.map((app, i) => (
                <tr key={i}>
                  <td>{app.course}</td>
                  <td>{app.status}</td>
                  <td>{app.date}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>

      {/* Keep your existing <style> block here */}
    </div>
  );
};

export default StuProfile;
